  /**
   * 将网络图片进行Base64位编码
   * 
   * @param imgUrl
   *			图片的url路径，如http://.....xx.jpg
   * @return
   */
  public static String encodeImgageToBase64(URL imageUrl) {// 将图片文件转化为字节数组字符串，并对其进行Base64编码处理
    ByteArrayOutputStream outputStream = null;
    try {
      BufferedImage bufferedImage = ImageIO.read(imageUrl);
      outputStream = new ByteArrayOutputStream();
      ImageIO.write(bufferedImage, "jpg", outputStream);
    } catch (MalformedURLException e1) {
      e1.printStackTrace();
    } catch (IOException e) {
      e.printStackTrace();
    }
    // 对字节数组Base64编码
    return Base64.encode(outputStream.toByteArray());// 返回Base64编码过的字节数组字符串
  }

  /**
   * 将本地图片进行Base64位编码
   * 
   * @param imgUrl
   *			图片的url路径，如http://.....xx.jpg
   * @return
   */
  public static String encodeImgageToBase64(File imageFile) {// 将图片文件转化为字节数组字符串，并对其进行Base64编码处理
    ByteArrayOutputStream outputStream = null;
    try {
      BufferedImage bufferedImage = ImageIO.read(imageFile);
      outputStream = new ByteArrayOutputStream();
      ImageIO.write(bufferedImage, "jpg", outputStream);
    } catch (MalformedURLException e1) {
      e1.printStackTrace();
    } catch (IOException e) {
      e.printStackTrace();
    }
    // 对字节数组Base64编码
    return Base64.encode(outputStream.toByteArray());// 返回Base64编码过的字节数组字符串
  }

  /**
   * 将Base64位编码的图片进行解码，并保存到指定目录
   * 
   * @param base64
   *			base64编码的图片信息
   * @return
   */
  public static void decodeBase64ToImage(String base64, String path,
      String imgName) {
    try {
      FileOutputStream write = new FileOutputStream(new File(path
          + imgName));
      byte[] decoderBytes = Base64.decode(base64);
      write.write(decoderBytes);
      write.close();
    } catch (IOException e) {
      e.printStackTrace();
    }
  }
  public static final InputStream byte2Input(byte[] buf) {  
      return new ByteArrayInputStream(buf);  
  }  
  public static final void basePngtoJpg(String avatar, String pathfile) {
	  BufferedImage bufferedImage;
	    try {
	      //String avatar = "data:image/png;base64,";
	  	  avatar=avatar.substring(avatar.indexOf("base64,")+7);
	      byte[] decoderBytes = Base64.decode(avatar);
	      InputStream is = byte2Input(decoderBytes);
	      //read image file
	      bufferedImage = ImageIO.read(is);

	      // create a blank, RGB, same width and height, and a white background
	      BufferedImage newBufferedImage = new BufferedImage(bufferedImage.getWidth(),
	            bufferedImage.getHeight(), BufferedImage.TYPE_INT_RGB);
	      newBufferedImage.createGraphics().drawImage(bufferedImage, 0, 0, Color.WHITE, null);

	      // write to jpeg file
	      ImageIO.write(newBufferedImage, "jpg", new File(pathfile));
	    } catch (IOException e) {

	      e.printStackTrace();

	    }
  }
  /** 
   * Created on 2011-5-24 Discription:[convert GIF->JPG GIF->PNG PNG->GIF(X) 
   * PNG->JPG ] 
   *  
   * @param source 
   * @param formatName 
   * @param result 
   * @author:利用JDK原生支持对png jpg gif格式图片做相互转换，结合脚本就可以达到批量处理的能力，
   * 比PS来的快啊！而且是JAVA代码 在Windows和Linux上都可以用。
   */  
  public static void convert(String source, String formatName, String result) {  
      try {  
          File f = new File(source);  
          f.canRead();  
          BufferedImage src = ImageIO.read(f);  
          ImageIO.write(src, formatName, new File(result));  
      } catch (Exception e) {  
          e.printStackTrace();  
      }  
  }
  public static final byte[] input2byte(InputStream inStream)  
          throws IOException {  
      ByteArrayOutputStream swapStream = new ByteArrayOutputStream();  
      byte[] buff = new byte[100];  
      int rc = 0;  
      while ((rc = inStream.read(buff, 0, 100)) > 0) {  
          swapStream.write(buff, 0, rc);  
      }  
      byte[] in2b = swapStream.toByteArray();  
      return in2b;  
  }  
